import React from 'react'
import HackerNews from './Components/HackerNews'

export default function App() {
    return (
        <>
           <HackerNews info={realInfo}/> 
        </>
    )
}

const realInfo = [
    {
        heading : '',
        person  : '',
        upvote  : 3 ,
        comment : 22,
        point   : 11
    }
]
